import React, { useState } from "react";
import "./BookingConsultation.css"; // optional: create a CSS file for styling
import DoctorCard from "../DoctorCard/DoctorCard";
import FindDoctorSearch from "../FindDoctorSearch/FindDoctorSearch"; // your search component

const BookingConsultation = () => {
  const [searchTerm, setSearchTerm] = useState(""); // for searching doctors

  // Example doctor data — you can fetch from API or keep as static array
  const doctors = [
    {
      id: 1,
      name: "Dr. John Doe",
      speciality: "Cardiologist",
      experience: 10,
      ratings: 4.5,
      image: "https://via.placeholder.com/150",
    },
    {
      id: 2,
      name: "Dr. Jane Smith",
      speciality: "Dermatologist",
      experience: 7,
      ratings: 4.8,
      image: "https://via.placeholder.com/150",
    },
    // add more doctors if needed
  ];

  // Filter doctors by search term
  const filteredDoctors = doctors.filter(
    (doctor) =>
      doctor.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      doctor.speciality.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="booking-consultation-container">
      <h1>Book a Consultation</h1>

      {/* Doctor search */}
      <FindDoctorSearch
        searchTerm={searchTerm}
        setSearchTerm={setSearchTerm}
      />

      {/* Display doctor cards */}
      <div className="doctor-cards-container">
        {filteredDoctors.map((doctor) => (
          <DoctorCard
            key={doctor.id}
            name={doctor.name}
            speciality={doctor.speciality}
            experience={doctor.experience}
            ratings={doctor.ratings}
            image={doctor.image}
          />
        ))}
      </div>
    </div>
  );
};

export default BookingConsultation;
